import React, { Component } from 'react';
import "survey-react/survey.css";
import * as Survey from "survey-react";
import { showCompletionScript } from "yargs";

class Surveyform extends Component {
  constructor(props){
    super(props)
    this.state = {

    }
    this.onCompleteComponent = this.onCompleteComponent.bind(this)
  }
  onCompleteComponent = () => {
    this.setState({
      isCompleted: true
    })
  }

  render() {
    var json = {
      pages: [
       {
        name: "page1",
        elements: [
         {
          type: "comment",
          name: "question2",
          title: "Feedback"
         },
         {
          type: "boolean",
          name: "question3",
          title: "Add Friend"
         },
         {
          type: "boolean",
          name: "question4",
          title: "Skip (button)"
         },
         {
          type: "rating",
          name: "question1",
          title: "Rate me",
          rateMax: 10
         }
        ]
       }
      ]
     }
    var surveyRender = !this.state.isCompleted ? (
      <Survey.Survey
      json={json}
      showCompletedPage={false}
      onComplete={this.onCompleteComponent}
      />
    ) : null 

    var onSurveyCompletion = this.state.isCompleted ? (
      <div>Thanks for completing survey</div>
    ) : null;

    return (
      <div>
        <input type="text" placeholder="Feedback" name="feedback"></input>
        <input type="text" placeholder="Feedback" name="feedback"></input>
        <button>Skip</button>
      </div>
    )
  }
}

export default Surveyform;
